def display_map(map, header=''):
    num_row, num_col = len(map), len(map[0])
    if header:
        print(header)
    for i in range(num_row):
        for j in range(num_col):
            print(map[i][j], end='')
        print()
    print()

display_map(input_map, 'input map')

# do expansion
expand_map = None

# expand row
t_map = []
for row in range(INPUT_NUM_ROW):
    t_map.append(input_map[row])
    if all([element == '.' for element in input_map[row]]):
        t_map.append([*'.'*INPUT_NUM_COL])

expand_map = t_map

# display_map(expand_map)

