def get_min_distance(coordinate_a, coordinate_b):
    a_row, a_col = coordinate_a[0], coordinate_a[1]
    b_row, b_col = coordinate_b[0], coordinate_b[1]
    return (max(a_row, b_row) - min(a_row, b_row)) + (max(a_col, b_col) - min(a_col, b_col))


